sys_variable_value.value:
(function execute(inputs, outputs) {
  outputs.status = inputs.status_code
  outputs.response_body = inputs.response

  if (inputs.status_code < 200 && inputs.status_code >= 300) {
    var errorMessage = "Status Code: " + inputs.status_code + " "
  	errorMessage += inputs.response
    gs.error(errorMessage)
  }
  else {
    try {
      outputs.response_json = JSON.parse(outputs.response_body);
    } catch (error) {
      gs.debug(error);
    }    
  }

})(inputs, outputs);

